
/**
The `Vec4` class contains a 4D coordinate.
*/
declare interface Vec4 {

/**
```
(get) w: number
(set) w: number
```

Specifies the w coordinate.
*/
w: number

/**
```
(get) x: number
(set) x: number
```

Specifies the x coordinate.
*/
x: number

/**
```
(get) y: number
(set) y: number
```

Specifies the y coordinate.
*/
y: number

/**
```
(get) z: number
(set) z: number
```

Specifies the z coordinate.
*/
z: number

}
